import Button from 'react-bootstrap/Button';
import { Outlet, Link } from "react-router-dom";

function NewButton() {
    const shoot = (a) => {
        alert(a)
    }


  return (
    <>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/alert">Alert</Link>
          </li>
          <li>
            <Link to="/grid">Grid</Link>
          </li>
          <li>
            <Link to="/form">Form</Link>
          </li>
          <li>
            <Link to="/list">List</Link>
          </li>
        </ul>
      </nav>

      <Outlet />
    </>
  );
}

export default NewButton;
